import React from 'react';

const Category = () => {
  return (
    <div>
      <h2>CATEGORIES</h2>
      <span>APPLE</span>
      <button>All</button>
      <span>IPHONE & MAC</span>
      <button>Iphone</button>
      <button>Ipad</button>
      <button>Macbook</button>
      <span>WIRELESS</span>
      <button>Airpod</button>
      <button>Watch</button>
      <span>OTHER</span>
      <button>Mouse</button>
      <button>Keyboard</button>
      <button>Other</button>
    </div>
  );
};

export default Category;
